// Define a type for the icon names based on the iconMap
type IconName = keyof typeof Icons;

// Define the props for the DynamicIcon component
interface DynamicIconProps {
    name: IconName;
    // Add other props if needed
    [key: string]: any; // This allows additional props like color, fontSize, etc.
}

const iconMap: { [key in IconName]: React.ComponentType<any> } = Icons;

const Icon: React.FC<DynamicIconProps> = ({ name, ...props }) => {
    const IconComponent = iconMap[name];
    return IconComponent ? <IconComponent {...props} /> : null;
};

export default Icon;